import React from 'react';
import './friendList.css';
import {Link} from 'react-router-dom';

function FriendList({userImage, name, message, url}) : any {
  return (
    <Link to={url}>
        <li>
                <img className="friend_image" src={userImage}/>
                <span className="friend_name">{name}</span>
                <span className="friend_message">{message}</span>
        </li>
    </Link>
  );
}

export default FriendList;
